import React from 'react';
import { VictoryPie, VictoryTheme } from 'victory';

const PieChart = () => {

  return (
    <VictoryPie
    radius={({ datum }) => datum.y + 75}
    data={[
      { x: "Cats", y: 30 },
      { x: "Dogs", y: 35 },
      { x: "Birds", y: 25 },
      { x: "Rabbits", y: 10 },
    ]}
    theme={VictoryTheme.clean}

      x="category"
      y="value"
      style={{
        data: {
          fillOpacity: 0.8,
          stroke: "#000",
          strokeWidth: 2
        },
        labels: { fontSize: 15, fill: "#333" }
      }}

      colorScale={["#c43a31", "#ffcc00", "#00a2ff", "#ffa500"]} // Renk skalası
    />
  );
};

export default PieChart;
